import api from "../apis/api";

export const logIn = formValues => async dispatch => {
  console.log(formValues);
  await api.post('/login', formValues)
  .then(response => {
    console.log(response.data)
  });
  console.log(response);
  dispatch({
    type: 'LOG_IN',
    payload: response
  });
};
